{"negative":{"rating":2,"review":"its pretty and darkens perfectly while its setting but every time i rinse it runs off some of the hair and sticks on others. ive never had much luck with this brand but was hoping this would stick. ive done it twice and still cant get it to take. but idk about other colors and im always willing to try the same thing with different colors so we'll see for the next time. photos are after 1st and 2nd with the light blue. my hair has always dyed extremely well so this was disappointing to say the least."},"positive":{"rating":4,"review":"I had been getting my hair highlighted in the salon over the past few months but the blonde and the base color were very warm. I tried going to the salon to have the color toned but the results lasted a matter of days. I even bought special toning shampoos and conditioners and those still didn't tone my hair down to the desired look so I decided it was time to go back to box dye.

This color caught my eye because it was a very dark and cool toned shade of brown. The application of the product was somewhat easy on my long hair and the smell was not too overbearing. 

After washing and drying my hair I was surprised at how light the color turned out. My highlights are more blended but you can still see the color variations in my hair. I would say this color is closer to a medium brown then a dark brown. It has a little bit of warmth to it. It didn't exactly turn out like the photo on the box but I'm still happy with the color. My hair also feels soft to the touch and looks healthier than before I colored it. I will be using this product again in a few months to touch up the color."}}
